import React from "react";
import "./App.css";
import Post from "./component/Post";

const App = () => {
  return (
    <main>
      <header>
        <a href="#" className="logo">
          MYBLOG
        </a>
        <nav>
          <a href="#">Login</a>
          <a href="#">Register</a>
        </nav>
      </header>
      <Post />
      <Post />
      <Post />
    </main>
  );
};

export default App;
